import React from 'react';

 const Navbar = ({friends})=>{
    const friendsList = friends.map(friend=>{
        return(
           <div>
               <ul key={friend.id}>
                   <li>{friend.name}</li>
                   <li>{friend.interest}</li>
                   <li>{friend.age}</li>
               </ul>
           </div>
        )          
       })

       return(
        <div>
        {friendsList}
        </div>
    )      

}

export default Navbar
